import React from 'react';
import phoneIcon from './assets/phone.png';

const navLinkStyle = {
  fontFamily: 'Sora, sans-serif',
  fontWeight: 400,
  fontSize: '18px',
  lineHeight: '23px',
  letterSpacing: '-0.05em',
  color: '#1E1E1E',
  textDecoration: 'none',
  height: '23px',
  display: 'flex',
  alignItems: 'center',
  whiteSpace: 'nowrap',
  padding: '0 1vw',
};

const Menu = () => {
  return (
    <nav
      className="frame-container menu-bar"
      style={{
        height: '130px',
        background: '#FFF',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        padding: '0 45px',
        flexWrap: 'nowrap',
      }}
    >
      {/* Left: Logo */}
      <div
        style={{
          width: '100px',
          height: '100px',
          borderRadius: '50%',
          background: '#FFF',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          marginLeft: '32px',
        }}
      >
        <img
          src="/logo.png"
          alt="Booktranspo Logo"
          style={{ width: '90px', height: '90px', objectFit: 'contain', borderRadius: '50%', background: 'transparent' }}
        />
      </div>
      {/* Center: Navigation Links */}
      <div
        style={{
          display: 'flex',
          alignItems: 'center',
          gap: '64px',
          height: '23px',
          justifyContent: 'center',
          flexWrap: 'nowrap',
          overflowX: 'auto',
          whiteSpace: 'nowrap',
          flex: 1,
          margin: '0 24px',
        }}
      >
        <a href="#home" style={navLinkStyle}>Home</a>
        <a href="#why-booktranspo" style={navLinkStyle}>Why Booktranspo</a>
        <a href="#delivery-partners" style={navLinkStyle}>Delivery Partners</a>
        <a href="#transport-partners" style={navLinkStyle}>Transport Partners</a>
        <a href="#join-us" style={navLinkStyle}>Join Us</a>
      </div>
      {/* Right: Phone image */}
      <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', width: '308px', height: '110px', marginRight: '0px' }}>
        <img
          src={phoneIcon}
          alt="Contact Us"
          style={{ width: '308px', height: '110px', objectFit: 'contain', borderRadius: '100px', marginTop: '20px' }}
        />
      </div>
    </nav>
  );
};

export default Menu;
